window.bookSummaryJSON = "<p><b>Who do you trust when you can’t even trust yourself?</b></p> <p>Everything I knew was a lie.</p> <p>Everyone I loved betrayed me.</p> <p>Everywhere I go someone wants me dead.</p> <p>I’m no stranger to being alone. Even in my darkest hour, I knew I could count only on myself. Now, I have nothing and for the first time in my life I have to let someone else save me.</p> <p>This story is NOT a standalone and must be listened to after <i>Ruins of Temptation</i>. This audiobook contains dark-material that might be triggering to some listeners.</p>"; 
